        bd={"1px solid black"}
        height={"1.5rem"}
        mg={"2rem"}
      >
        <Card bd={"1px solid red"}></Card>
        <Card bd={"1px solid red"}></Card>
        <Card bd={"1px solid red"}></Card>
      </Card>
    </>
  );
};

export default NavBar;
